import { Send, Bell, AlertTriangle, CheckCircle2, Users } from "lucide-react";

export default function Header() {
  const [showNotifications, setShowNotifications] = useState(false);

  return (
    <div className="flex items-center justify-between h-20 bg-white shadow-md px-6 sticky top-0 z-20">

      <h2 id="page-title" className="text-2xl font-semibold text-gray-800">
        Dashboard
      </h2>
      <div className="flex items-center space-x-4">

        <div className="flex items-center space-x-2">
          <img
            src="https://placehold.co/40x40/E2E8F0/4A5568?text=A"
            alt="Admin"
            className="w-10 h-10 rounded-full"
          />
          <div>
            <p className="font-semibold text-sm">Anjali Sharma</p>
            <p className="text-xs text-gray-500">Health Official</p>
          </div>
        </div>
      </div>
    </div>
  );
}
